INSERT INTO `products` VALUES (4,'Laptop Acer Aspire 3',4,650,6500,650,100,'<h3><a title=\"Laptop Acer Aspire A315 56 308N i3 (NX.HS5SV.00C)\" href=\"https://www.thegioididong.com/laptop/acer-aspire-a315-56-308n-i3-nxhs5sv00c\" target=\"_blank\" rel=\"noopener\">Laptop Acer Aspire A315 56 308N i3 (NX.HS5SV.00C)</a>&nbsp;l&agrave; mẫu laptop học tập văn ph&ograve;ng thuộc ph&acirc;n kh&uacute;c gi&aacute; thấp. M&aacute;y trang bị vi xử l&yacute; thế hệ mới của Intel, cho hiệu năng đủ d&ugrave;ng đối với c&aacute;c nhu cầu cơ bản, ph&ugrave; hợp với học sinh v&agrave; sinh vi&ecirc;n.</h3>\r\n<h3>Chip xử l&yacute; t&acirc;n tiến nhất</h3>\r\n<p><a title=\"Xem th&ecirc;m c&aacute;c sản phẩm laptop Acer đang b&aacute;n tại Thegioididong.com\" href=\"https://www.thegioididong.com/laptop-acer\" target=\"_blank\" rel=\"noopener\">Laptop Acer</a>&nbsp;Aspire A315 sử dụng vi xử l&yacute; Intel&nbsp;<strong><a title=\"Xem th&ecirc;m c&aacute;c laptop Core i3 đang b&aacute;n tại Thegioididong.com\" href=\"https://www.thegioididong.com/laptop?g=core-i3\" target=\"_blank\" rel=\"noopener\">Core i3</a></strong>&nbsp;thế hệ 10, cho hiệu năng ổn định, hỗ trợ bạn xử l&yacute; tốt c&aacute;c t&iacute;nh năng văn ph&ograve;ng như soạn thảo văn bản tr&ecirc;n Word, nhập liệu qua Excel,... với tốc độ CPU đạt&nbsp;1.20 GHz v&agrave; &eacute;p xung tối đa l&ecirc;n đến&nbsp;3.4 GHz nhờ&nbsp;Turbo Boost.</p>\r\n<p>M&aacute;y trang bị sẵn&nbsp;<strong><a title=\"Laptop được trang bị RAM 4 GB đang kinh doanh tại Thegioididong.com\" href=\"https://www.thegioididong.com/laptop?g=4-gb\" target=\"_blank\" rel=\"noopener\">4 GB RAM</a></strong>&nbsp;v&agrave; một khe trống để người d&ugrave;ng c&oacute; thể n&acirc;ng cấp RAM l&ecirc;n tối đa 12 GB tối ưu nhu cầu học tập v&agrave; l&agrave;m việc cho bạn, đ&aacute;p ứng tốt đa nhiệm, bạn c&oacute; thể vừa duyệt web vừa nhập liệu hay viết b&aacute;o c&aacute;o c&ugrave;ng một l&uacute;c</p>\r\n<p>Đ&acirc;y l&agrave; một cấu h&igrave;nh kh&ocirc;ng mạnh, nhưng đủ d&ugrave;ng đối với những ai chỉ sử dụng m&aacute;y cho c&aacute;c nhu cầu cơ bản như Word, Excel, học tập trực tuyến qua&nbsp;<a title=\"T&igrave;m hiểu th&ecirc;m về ứng dụng Zoom\" href=\"https://www.thegioididong.com/game-app/zoom-cloud-meetings-tao-cuoc-hop-online-221386\" target=\"_blank\" rel=\"noopener\">Zoom</a>,&nbsp;<a title=\"T&igrave;m hiểu th&ecirc;m về phần mềm Microsoft Teams\" href=\"https://www.thegioididong.com/game-app/microsoft-teams-hop-truc-tuyen-voi-500-nguoi-tro-226715\" target=\"_blank\" rel=\"noopener\">Microsoft Teams</a>,... hay lướt web, xem phim giải tr&iacute;.&nbsp;</p>','2022-01-09 13:33:23','2022-02-09 13:33:21',0,NULL,3,1,1,1,'product/kmczxulff5zkjyl6biph');
INSERT INTO `products` VALUES (5,'Laptop ASUS Gaming ROG',4,1000,NULL,1000,100,'<h2><strong>Laptop ASUS Gaming ROG Strix G15 G513IH-HN015T &ndash; Laptop gaming mỏng nhẹ</strong></h2>\r\n<p>Kh&ocirc;ng c&ograve;n l&agrave;m một mẫu laptop gaming nặng nề,&nbsp;<strong><a title=\"Laptop Asus Gaming ch&iacute;nh h&atilde;ng\" href=\"https://cellphones.com.vn/laptop/asus/gaming.html\" target=\"_self\">ASUS Gaming</a>&nbsp;ROG Strix G15 G513IH-HN015T</strong>&nbsp;với thiết kế nhỏ gọn nhưng vẫn đảm bảo một hiệu năng mạnh mẽ c&ugrave;ng thiết kế đậm chất gaming.</p>\r\n<h3><strong>Thiết kế sang trọng, logo Gaming ROG, viền m&agrave;n h&igrave;nh si&ecirc;u mỏng</strong></h3>\r\n<p>Laptop ASUS Gaming ROG Strix G15 G513IH-HN015T sở hữu thiết kế kh&aacute; gọn nhẹ so với một chiếc laptop gaming th&ocirc;ng thường. M&aacute;y với trọng lượng chỉ khoảng hơn 2kg, nắp lưng thiết hế logo ROG.</p>\r\n<p>Mặt trước l&agrave; m&agrave;n h&igrave;nh 15,6 inch với khung viền si&ecirc;u mỏng ở ba cạnh. M&agrave;n h&igrave;nh IPS n&agrave;y với độ ph&acirc;n giải cao c&ugrave;ng tần số qu&eacute;t 144Hz mang lại trải nghiệm hiểu thị tốt, chuyển cảnh mượt m&agrave;.</p>\r\n<h3><strong>Hoạt động ổn định với chip H, hệ thống 2 loa chất lượng</strong></h3>\r\n<p>Laptop ASUS Gaming ROG Strix G15 G513IH-HN015T mang lại hiệu năng si&ecirc;u ấn tượng nhờ bộ vi xử l&yacute; d&ograve;ng H mạnh mẽ. Kết hợp với 8GB RAM, Asus G513IH-HN015T cho khả năng đa nhiệm tốt, hoạt động mượt m&agrave; từ những t&aacute;c vụ cơ bản như lướt web, xem phim đến c&aacute;c t&aacute;c vụ năng như đồ họa, chơi game.</p>\r\n<p>M&aacute;y được trang bị ổ cứng SSD 512GB mang lại kh&ocirc;ng gian lưu trữ lớn c&ugrave;ng tốc độ đọc &ndash; ghi nhanh vượt trội.</p>\r\n<p>Ngo&agrave;i ra, với hệ thống hai loa &acirc;m thanh chất lượng, ASUS Gaming ROG Strix G15 G513IH-HN015T mang lại cho người d&ugrave;ng những ph&uacute;t gi&acirc;y đắm ch&igrave;m trong những giai điệu chất lượng.</p>','2022-01-09 14:13:33','2022-03-09 14:13:31',0,NULL,3,0,1,1,'product/adzgfmwrtcythqbbfxye');
INSERT INTO `products` VALUES (6,'Surface Pro 7',4,900,9000,900,150,'<h2>Microsoft Surface Pro 7 i5/8/128 &ndash; Ph&ugrave; hợp c&ocirc;ng việc v&agrave; giải tr&iacute; cơ bản</h2>\r\n<p><strong>H&agrave;ng nhập khẩu ch&iacute;nh h&atilde;ng bởi nh&agrave; ph&acirc;n phối, đầy đủ chứng từ nguồn gốc xuất xứ, gi&aacute; đ&atilde; bao gồm thuế VAT.&nbsp;Bảo h&agrave;nh đổi mới 30 ng&agrave;y tại CellphoneS v&agrave; 12 th&aacute;ng tại FPT Service.</strong></p>\r\n<p>Tiếp nối th&agrave;nh c&ocirc;ng của d&ograve;ng Surface Pro, Microsoft tiếp tục gi&agrave;nh vị thế của m&igrave;nh bằng c&aacute;ch cho ra đời tiếp theo sản phẩm&nbsp;<strong><a href=\"https://cellphones.com.vn/laptop/surface.html\" target=\"_blank\" rel=\"noopener\">Surface</a>&nbsp;Pro 7</strong>&nbsp;v&agrave; được nhiều người đ&aacute;nh gi&aacute; rất t&iacute;ch cực.</p>\r\n<h3>Trọng lượng chỉ 776g, ho&agrave;n thiện từ vỏ nh&ocirc;m cao cấp</h3>\r\n<p>Ngo&agrave;i việc được trang bị th&ecirc;m một cổng&nbsp;USB-C&nbsp;mới, c&oacute; vẻ như ho&agrave;n to&agrave;n kh&ocirc;ng c&oacute; g&igrave; thay đổi về thiết kế Surface Pro 6. Chiếc Surface Pro 7 vẫn c&oacute; k&iacute;ch thước 11,5 x 7,9 x 0,33 inch (292 x 201 x 8,5mm) v&agrave; nặng 1,7 pounds (776g). C&oacute; thể thấy n&oacute; c&oacute; trọng lượng rất nhẹ ho&agrave;n to&agrave;n dễ d&agrave;ng để mang theo v&agrave; di chuyển dễ d&agrave;ng.</p>','2022-01-09 14:38:34','2022-01-23 14:38:32',0,NULL,3,0,1,1,'product/dovlj62cwsz6oixk7kuu');
INSERT INTO `products` VALUES (7,'Samsung Galaxy Z Fold3 5G',5,1800,18000,1800,200,'<h3><a title=\"Tham khảo gi&aacute; điện thoại Samsung Galaxy Z Fold3 5G 256GB ch&iacute;nh h&atilde;ng\" href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-z-fold-3\" target=\"_blank\" rel=\"noopener\">Galaxy Z Fold3 5G</a>, chiếc&nbsp;<a title=\"Tham khảo gi&aacute; điện thoại smartphone ch&iacute;nh h&atilde;ng\" href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\" rel=\"noopener\">điện thoại</a>&nbsp;được n&acirc;ng cấp to&agrave;n diện về nhiều mặt, đặc biệt đ&acirc;y l&agrave; điện thoại m&agrave;n h&igrave;nh gập đầu ti&ecirc;n tr&ecirc;n thế giới c&oacute; camera ẩn (08/2021). Sản phẩm sẽ l&agrave; một &ldquo;c&uacute; hit&rdquo; của&nbsp;<a title=\"Tham khảo sản phẩm Samsung ch&iacute;nh h&atilde;ng tại Thegioididong.com\" href=\"https://thegioididong.com/samsung\" target=\"_blank\" rel=\"noopener\">Samsung</a>&nbsp;g&oacute;p phần mang đến những trải nghiệm mới cho người d&ugrave;ng.</h3>\r\n<h3>Thiết kế n&acirc;ng tầm smartphone m&agrave;n h&igrave;nh gập</h3>\r\n<p>C&oacute; thể thấy mẫu smartphone Galaxy Z Fold3 lần n&agrave;y vẫn giữ nguy&ecirc;n ngoại h&igrave;nh c&ugrave;ng cơ chế m&agrave;n h&igrave;nh gập mở dạng quyển s&aacute;ch như của tiền nhiệm, hồ biến chiếc smartphone th&agrave;nh một chiếc m&aacute;y t&iacute;nh bảng mini một c&aacute;ch dễ d&agrave;ng v&agrave; ngược lại.</p>\r\n<h3>Đột ph&aacute; m&agrave;n h&igrave;nh gập với camera ẩn&nbsp;</h3>\r\n<p>M&agrave;n h&igrave;nh Samsung sử dụng tấm nền Dynamic AMOLED 2X, phần viền của m&agrave;n h&igrave;nh ch&iacute;nh cũng được h&atilde;ng tối ưu tinh giản lại, thiết kế mang đến phần viền si&ecirc;u mỏng cho cảm gi&aacute;c tr&agrave;n viền tinh tế hơn nh&igrave;n rất đẹp v&agrave; bắt mắt.&nbsp;</p>\r\n<p>Đặc biệt, Z Fold3 c&ograve;n l&agrave; chiếc điện thoại gập đầu ti&ecirc;n tr&ecirc;n thế giới c&oacute; camera ẩn dưới m&agrave;n h&igrave;nh mang đến những trải nghiệm liền mạch, đ&atilde; mắt hơn.</p>\r\n<p>M&agrave;n h&igrave;nh trong được phủ lớp k&iacute;nh Ultra Thin Glass (UTG) mỏng vượt trội gi&uacute;p tăng độ bền hơn 80% so với tiền nhiệm, mang đến độ bền cực cao khi c&oacute; thể đ&oacute;ng mở dễ d&agrave;ng m&agrave; kh&ocirc;ng l&agrave;m ảnh hưởng đến khả năng hiển thị v&agrave; cảm ứng của m&agrave;n h&igrave;nh.</p>','2022-01-09 14:44:46','2022-01-30 14:44:44',0,NULL,2,1,1,0,'product/vf6fqfcqcxlu7u8t16gm');
INSERT INTO `products` VALUES (8,'Samsung Galaxy S21 Ultra 5G',5,800,8000,1700,150,'<h3>Sự đẳng cấp được&nbsp;<a title=\"Tham khảo sản phẩm Samsung kinh doanh tại thegioididong.com\" href=\"https://www.thegioididong.com/samsung\" target=\"_blank\" rel=\"noopener\">Samsung</a>&nbsp;gửi gắm th&ocirc;ng qua chiếc&nbsp;<a title=\"Tham khảo điện thoại smartphone ch&iacute;nh h&atilde;ng tại Thế Giới Di Động\" href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\" rel=\"noopener\">smartphone</a>&nbsp;Galaxy S21 Ultra 5G với h&agrave;ng loạt sự n&acirc;ng cấp v&agrave; cải tiến kh&ocirc;ng chỉ ngoại h&igrave;nh b&ecirc;n ngo&agrave;i m&agrave; c&ograve;n sức mạnh b&ecirc;n trong, hứa hẹn đ&aacute;p ứng trọn vẹn nhu cầu ng&agrave;y c&agrave;ng cao của người d&ugrave;ng.</h3>\r\n<h3>Đột ph&aacute; trong thiết kế thời thượng</h3>\r\n<p>Kh&ocirc;ng chỉ đơn thuần phục vụ giao tiếp v&agrave; giải tr&iacute;,&nbsp;<a title=\"Tham khảo điện thoại Samsung Galaxy S21 Ultra 5G ch&iacute;nh h&atilde;ng tại Thế Giới Di Động\" href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-s21-ultra\" target=\"_blank\" rel=\"noopener\">Samsung Galaxy S21 Ultra 5G</a>&nbsp;c&ograve;n ch&iacute;nh l&agrave; m&oacute;n phụ kiện thời trang khẳng định vị thế của người sở hữu. Vẻ ngo&agrave;i mảnh mai v&agrave; thon gọn đến bất ngờ chỉ 165.1 x 75.6 x 8.9 mm v&agrave; trọng lượng 228 g d&ugrave; phải &ldquo;v&aacute;c&rdquo; một vi&ecirc;n pin lớn.</p>','2022-01-09 14:52:25','2022-02-13 14:52:24',5,3,2,0,1,0,'product/f7quphy64y9ttypur6in');
INSERT INTO `products` VALUES (9,'Samsung Galaxy Z Flip3 5G',5,900,10000,1000,50,'<h2><strong>Samsung Galaxy Z Flip 3 (5G) &ndash; Điện thoại m&agrave;n h&igrave;nh</strong><strong>&nbsp;gập độc đ&aacute;o</strong></h2>\r\n<p>B&ecirc;n cạnh c&aacute;c si&ecirc;u phẩm của d&ograve;ng S hay d&ograve;ng Note th&igrave; Samsung c&ograve;n tr&igrave;nh l&agrave;ng một d&ograve;ng điện thoại si&ecirc;u đặc biệt. V&agrave; cho đến 2021 h&atilde;ng đ&atilde; ph&aacute;t triển đến thế hệ thứ ba, với t&ecirc;n gọi&nbsp;<strong>Galaxy Z Flip 3</strong>. Ngo&agrave;i sở hữu thiết kế gập độc đ&aacute;o th&igrave; n&oacute; c&ograve;n sở hữu t&iacute;nh năng g&igrave; mới h&atilde;y c&ugrave;ng ch&uacute;ng t&ocirc;i xem qua b&agrave;i viết b&ecirc;n dưới đ&acirc;y nh&eacute;.</p>\r\n<p>Dự kiến, Z Flip 3 5G sẽ được Samsung tr&igrave;nh l&agrave;ng c&ugrave;ng với&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-z-fold-3.html\">điện thoại Galaxy Z Fold 3 5G</a>&nbsp;tại sự kiện ra mắt trực tuyến Unpacked diễn ra v&agrave;o ng&agrave;y 11/8 tới đ&acirc;y.</p>\r\n<h3><strong>Thiết kế đậm chất đặc trưng, m&agrave;n h&igrave;nh dẻo ti&ecirc;n phong</strong></h3>\r\n<p>Samsung Galaxy Z Flip 3 sở hữu một phong c&aacute;ch thiết kế gập vỏ s&ograve; c&ugrave;ng khung nh&ocirc;m&nbsp;aluminum chắc chắn.&nbsp;Khi gấp gọn, điện thoại chỉ c&oacute; k&iacute;ch thước 4.2 inch v&ocirc; c&ugrave;ng nhỏ gọn nhưng mở r&acirc; lại l&agrave; một chiếc điện thoại th&ocirc;ng minh m&agrave;n h&igrave;nh lớn mang lại khả năng kh&aacute;m ph&aacute; kh&ocirc;ng giới hạn. M&agrave;n h&igrave;nh ngo&agrave;i của thiết bị được trang bị mặt k&iacute;nh&nbsp;Gorilla Glass si&ecirc;u bền bỉ.</p>\r\n<p>Bản lề tr&ecirc;n Samsung Galaxy Z Flip 3 cũng được đ&aacute;nh gi&aacute; bền bỉ khi vượt qua b&agrave;i thử nghiệm l&ecirc;n đến 200000 lần, nhờ đ&oacute; người d&ugrave;ng c&oacute; thể thoải m&aacute;i sử dụng l&ecirc;n đến hơn 5 năm.</p>\r\n<p>Về m&agrave;u sắc, điện thoại Samsung Galaxy Z Flip 3 sẽ được b&aacute;n ra với nhiều phi&ecirc;n bản m&agrave;u như&nbsp;Kem Ivory,&nbsp;Đen Phantom,&nbsp;Xanh Phantom,&nbsp;T&iacute;m Lilac. Nhờ đ&oacute; người d&ugrave;ng c&oacute; nhiều sự lựa chọn m&agrave;u sắc hơn theo sở th&iacute;ch. M&aacute;y cũng sẽ được trang bị chẩn kh&aacute;ng nước v&agrave; bụi bẩn IPX8 tiện lợi.</p>\r\n<h3><strong>M&agrave;n h&igrave;nh gập độc đ&aacute;o, tần số qu&eacute;t 120Hz</strong></h3>\r\n<p>Như đ&atilde; bật m&iacute; về phần m&agrave;n h&igrave;nh v&agrave; đ&acirc;y ch&iacute;nh l&agrave; bộ phận g&acirc;y được sự ấn tượng đậm nhất. M&agrave;n h&igrave;nh&nbsp;Dynamic AMOLED 2X c&oacute; khả năng gập m&agrave; vẫn cho khả năng hiển thị ho&agrave;n hảo. Khi bạn mở m&agrave;n h&igrave;nh n&agrave;y ra th&igrave; n&oacute; lập tức hiện nay một k&iacute;ch thước 6.9 inch cho ph&eacute;p bạn thoải m&aacute;i t&ugrave;y chỉnh giao diện như g&oacute;c gập của m&agrave;n h&igrave;nh. Ngo&agrave;i ra, bạn cực kỳ y&ecirc;n t&acirc;m với thiết kế lớp k&iacute;nh dẻo UTG (Ultra Thin Glass) thế hệ mới.</p>','2022-01-09 14:57:53','2022-02-09 14:57:51',2,3,2,0,1,1,'product/jwwgcrfsxreyszsrsce3');
INSERT INTO `products` VALUES (10,'Apple iPad Pro 12.9 2021 M1 5G 256GB',6,1300,15000,1300,100,'<div class=\"box-outstanding-features\">\r\n<div class=\"box-title\">\r\n<h2>ĐẶC ĐIỂM NỔI BẬT</h2>\r\n</div>\r\n<div class=\"box-content\">\r\n<ul>\r\n<li>Hiển thị rực rỡ, sắc n&eacute;t - M&agrave;n h&igrave;nh c&ocirc;ng nghệ MiniLED, tần số qu&eacute;t 120Hz, độ s&aacute;ng tối đa 1600 nit</li>\r\n<li>Hiệu năng như m&aacute;y t&iacute;nh - Vi xử l&yacute; M1, 8GB RAM</li>\r\n<li>Chụp ảnh chất lượng, hỗ trợ AR ti&ecirc;n tiến - Camera k&eacute;p 12MP, cảm biến LiDAR cao cấp</li>\r\n<li>Giải tr&iacute; ng&agrave;y d&agrave;i kh&ocirc;ng lo cạn pin - Pin khủng 40,88W, sạc nhanh18W</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"blog-content\">\r\n<h2><strong>iPad Pro 12.9 inch 2021 - M&aacute;y t&iacute;nh bảng hiệu năng mạnh mẽ</strong></h2>\r\n<p>Nối tiếp th&agrave;nh c&ocirc;ng của c&aacute;c sản phẩm iPad thế hệ trước, năm nay Apple lại dự định tiếp tục cho ra mắt phi&ecirc;n bản iPad Pro 12.9 inch. Chiếc iPad thế hệ mới n&agrave;y dự đo&aacute;n sẽ nhận được nhiều sự săn đ&oacute;n của c&aacute;c fan Apple. Vậy điều g&igrave; l&agrave;m n&ecirc;n sức h&uacute;t của phi&ecirc;n bản&nbsp;<strong>iPad Pro&nbsp;2021 12.9 inch</strong>?</p>\r\n<h3><strong>Thiết kế sang trọng, m&agrave;n h&igrave;nh Mini-LED 12.9 inch</strong></h3>\r\n<p>Giống với những d&ograve;ng iPad tiền nhiệm, iPad Pro 12.9 phi&ecirc;n bản 2021 tiếp tục được Apple thiết kế với vẻ ngo&agrave;i sang trọng, hiện đại. K&iacute;ch thước của iPad 2021 gần giống với phi&ecirc;n bản năm 2020.</p>\r\n</div>','2022-01-09 14:59:22','2022-02-06 14:59:21',0,NULL,2,0,1,1,'product/z3ce20djv7vdjap0ccvq');
INSERT INTO `products` VALUES (11,'iPad Pro 12.9 2020 4G 128GB',6,1100,20000,1100,100,'<div class=\"item-box-table M&agrave;n h&igrave;nh\">\r\n<div class=\"box-title\">\r\n<p class=\"box-title__title\">M&agrave;n h&igrave;nh</p>\r\n</div>\r\n<div class=\"box-content\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<th>K&iacute;ch thước m&agrave;n h&igrave;nh</th>\r\n<th>12.9 inches</th>\r\n</tr>\r\n<tr>\r\n<th>C&ocirc;ng nghệ m&agrave;n h&igrave;nh</th>\r\n<th>IPS LCD</th>\r\n</tr>\r\n<tr>\r\n<th>Độ ph&acirc;n giải m&agrave;n h&igrave;nh</th>\r\n<th>2048 x 2732 pixels</th>\r\n</tr>\r\n<tr>\r\n<th>T&iacute;nh năng m&agrave;n h&igrave;nh</th>\r\n<th>Tần số qu&eacute;t 120Hz<br />Độ s&aacute;ng 600 nits</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"item-box-table Camera sau\">\r\n<div class=\"box-title\">\r\n<p class=\"box-title__title\">Camera sau</p>\r\n</div>\r\n<div class=\"box-content\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<th>Camera sau</th>\r\n<th>12 MP g&oacute;c rộng,khẩu độ f/1.8<br />10 MP g&oacute;c si&ecirc;u rộng,khẩu độ f/2.4</th>\r\n</tr>\r\n<tr>\r\n<th>Quay video</th>\r\n<th>Trước:&nbsp;1080p@30/60fps<br />Sau:&nbsp;2160p@24/30/60fps,&nbsp;1080p@30/60/120/240fps</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"item-box-table Camera trước\">\r\n<div class=\"box-title\">\r\n<p class=\"box-title__title\">Camera trước</p>\r\n</div>\r\n<div class=\"box-content\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<th>Camera trước</th>\r\n<th>7 MP,khẩu độ f/2.2</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"item-box-table Vi xử l&yacute; &amp; đồ họa\">\r\n<div class=\"box-title\">\r\n<p class=\"box-title__title\">Vi xử l&yacute; &amp; đồ họa</p>\r\n</div>\r\n<div class=\"box-content\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<th>Chipset</th>\r\n<th>Apple A12Z Bionic</th>\r\n</tr>\r\n<tr>\r\n<th>Loại CPU</th>\r\n<th>4 nh&acirc;n 2.5GHz<br />4 nh&acirc;n 1.6GHz</th>\r\n</tr>\r\n<tr>\r\n<th>GPU</th>\r\n<th>Apple GPU</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"item-box-table RAM &amp; lưu trữ\">\r\n<div class=\"box-title\">\r\n<p class=\"box-title__title\">RAM &amp; lưu trữ</p>\r\n</div>\r\n<div class=\"box-content\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<th>Dung lượng RAM</th>\r\n<th>6 GB</th>\r\n</tr>\r\n<tr>\r\n<th>Bộ nhớ trong</th>\r\n<th>128 GB</th>\r\n</tr>\r\n<tr>\r\n<th>Khe cắm thẻ nhớ</th>\r\n<th>Kh&ocirc;ng</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>','2022-01-09 15:02:34','2022-01-29 15:02:33',0,NULL,2,1,1,1,'product/z8jdp5gdos891dl455jz');
INSERT INTO `products` VALUES (12,'Apple iPad mini 6 4G 256G',6,900,NULL,900,100,'<div class=\"box-outstanding-features\">\r\n<div class=\"box-title\">\r\n<h2>ĐẶC ĐIỂM NỔI BẬT</h2>\r\n</div>\r\n<div class=\"box-content\">\r\n<ul>\r\n<li>Mạnh mẽ bứt ph&aacute; - Chip xử l&yacute; Apple A15 Bionic 6 nh&acirc;n</li>\r\n<li>Hiển thị sắc n&eacute;t, mượt m&agrave; hơn - M&agrave;n h&igrave;nh IPS LCD 8,3 inch hỗ trợ True Tone</li>\r\n<li>Ph&aacute; vỡ giới hạn s&aacute;ng tạo - Hỗ trợ Apple Pencil 2, iPadOS 15 tiện &iacute;ch hơn</li>\r\n<li>Camera bắt trọn mọi khoảnh khắc - Camera trước v&agrave; sau 12MP</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"blog-content\">\r\n<p><strong>Apple iPad mini 6 4G 256GB&nbsp;</strong>l&agrave; sản phẩm&nbsp;<a href=\"https://cellphones.com.vn/ipad-mini-6.html\">iPad mini 2021</a>&nbsp;Apple giới thiệu đến to&agrave;n thể c&ocirc;ng ch&uacute;ng. Phi&ecirc;n bản n&agrave;y cung cấp h&igrave;nh thức kết nối Wifi v&agrave; cả 4G, rất thuận tiện sử dụng ở bất kỳ nơi đ&acirc;u. M&aacute;y c&oacute; dung lượng lớn th&iacute;ch hợp lưu trữ nhiều dữ liệu</p>\r\n<p>C&ograve;n nếu bạn chỉ c&oacute; nhu cầu sử dụng tại nh&agrave; l&agrave; chủ yếu, phi&ecirc;n bản Wifi của m&aacute;y l&agrave;&nbsp;<a href=\"https://cellphones.com.vn/ipad-mini-6-256gb.html\">Apple iPad mini 6 256GB</a>&nbsp;ph&ugrave; hợp để bạn lựa chọn.</p>\r\n</div>','2022-01-09 15:04:26','2022-01-12 15:04:24',0,NULL,2,0,1,0,'product/qhxrc3zhbf9bgbjd1n1p');
INSERT INTO `products` VALUES (13,'Samsung Galaxy S20 FE 256GB (Fan Edition)',5,500,10000,500,50,'<h2>Điện thoại Samsung Galaxy S20 FE - Phi&ecirc;n bản đặc biệt d&agrave;nh cho fan Samsung</h2>\r\n<p><strong>Samsung S20 FE</strong>&nbsp;l&agrave; chiếc điện thoại sắp được ra mắt từ Samsung, với chữ FE đằng sau t&ecirc;n gọi của m&aacute;y c&oacute; nghĩa l&agrave; Fan Edition. Đ&acirc;y l&agrave; d&ograve;ng điện thoại ra mắt như để gửi lời tri &acirc;n đến c&aacute;c fan trung th&agrave;nh đ&atilde; v&agrave; đang sử dụng c&aacute;c sản phẩm của Samsung. Với số lượng sản phẩm được giới hạn v&agrave; chỉ mở b&aacute;n trong thời gian ngắn.&nbsp;&nbsp;</p>\r\n<p>Tham khảo th&ecirc;m&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-s21-fe.html\">điện thoại Samsung Galaxy S21 FE</a>&nbsp;với nhiều n&acirc;ng cấp về cấu h&igrave;nh, camera v&agrave; dung lượng pin.</p>\r\n<h3>M&agrave;n h&igrave;nh Super Amoled 6.5 inch, FullHD, c&ocirc;ng nghệ HDR10+, tần số qu&eacute;t 120Hz</h3>\r\n<p>Được định hướng vẫn l&agrave; sản phẩm ở ph&acirc;n kh&uacute;c cao cấp, Galaxy S20&nbsp;Fan Edition&nbsp;được trang bị tấm nền Super Amoled cao cấp, k&iacute;ch thước m&agrave;n h&igrave;nh lớn l&ecirc;n đến 6.5 inches, m&agrave;n h&igrave;nh độ ph&acirc;n giải FullHD gi&uacute;p h&igrave;nh ảnh hiển thị tr&ecirc;n chiếc điện thoại n&agrave;y l&agrave; v&ocirc; c&ugrave;ng sắc n&eacute;t v&agrave; rực rỡ.</p>','2022-01-09 15:06:05','2022-01-16 15:06:04',0,NULL,2,0,1,1,'product/yiisjlrhk1hmytav295i');
INSERT INTO `products` VALUES (14,'ASUS ROG Phone 5',5,800,NULL,800,100,'<div class=\"box-outstanding-features\">\r\n<div class=\"box-title\">\r\n<h2>ĐẶC ĐIỂM NỔI BẬT</h2>\r\n</div>\r\n<div class=\"box-content\">\r\n<ul>\r\n<li>Cấu h&igrave;nh khủng long, chiến mọi tựa game - Chip Snapdragon 888+ cực mạnh, hỗ trợ 5G</li>\r\n<li>M&agrave;n h&igrave;nh cực mượt, hiển thị sắc n&eacute;t - M&agrave;n h&igrave;nh AMOLED lớn 6.78\", 144Hz, HDR10</li>\r\n<li>Pin khủng, sủ dụng cực l&acirc;u - Vi&ecirc;n pin lớn 6000mAh, sạc nhanh 65W</li>\r\n<li>Bắt trọn mọi khoảnh khắc - Cụm 3 camera sau l&ecirc;n đến 64MP, hỗ trợ quay phim 8K cực đỉnh</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"blog-content\">\r\n<h2><strong>Đ&aacute;nh gi&aacute; Asus Rog Phone 5S &ndash; Điện thoại gaming chuy&ecirc;n nghiệp</strong></h2>\r\n<p>Ngo&agrave;i thống lĩnh thị trường laptop, Asus c&ograve;n hi&ecirc;n ngang th&aacute;ch thức cả thị trường điện thoại chơi game. Với sự ra đời của chiếc&nbsp;<strong>ROG Phone 5S</strong>&nbsp;như h&agrave;nh động củng cố th&ecirc;m tham vọng tr&ecirc;n của Asus.</p>\r\n<h3><strong>N&acirc;ng cấp thiết kế, bộ đ&ocirc;i m&agrave;n h&igrave;nh si&ecirc;u đẹp</strong></h3>\r\n<p>Kh&ocirc;ng cần phải c&oacute; vẻ ngo&agrave;i thật hầm hố, ASUS ROG Phone 5S vẫn c&oacute; thiết kế thật đặc trưng v&agrave; phong c&aacute;ch. Mặt lưng ch&iacute;nh l&agrave; điểm ấn tượng nhất của chiếc m&aacute;y n&agrave;y với những đường v&acirc;n cắt đầy chủ &yacute;, ph&acirc;n chia th&agrave;nh 3 khối kh&aacute;c nhau nhằm thu h&uacute;t người nh&igrave;n từ c&aacute;i chạm đầu ti&ecirc;n. Điểm nhấn vẫn thuộc về logo ROG được ho&agrave;n thiện từ c&aacute;c chấm đ&egrave;n lỗ RGB c&oacute; khả năng đổi m&agrave;u. C&ograve;n g&igrave; tuyệt hơn khi một chiếc điện thoại c&oacute; khả năng nhảy m&uacute;a m&agrave;u sắc dựa tr&ecirc;n c&aacute;c thao t&aacute;c chơi game của bạn phải kh&ocirc;ng n&agrave;o.</p>\r\n</div>','2022-01-09 15:25:34','2022-01-30 15:25:32',0,NULL,2,0,1,1,'product/fhky3o2cc8tlzt9itush');
INSERT INTO `products` VALUES (15,'Xiaomi Mi 11 Lite 5G',5,350,10000,350,10,'<div class=\"box-title\">\r\n<h2>ĐẶC ĐIỂM NỔI BẬT</h2>\r\n</div>\r\n<div class=\"box-content\">\r\n<ul>\r\n<li>Kh&ocirc;ng gian hiển thị thoải m&aacute;i, chuyển động mượt - M&agrave;n h&igrave;nh tr&agrave;n viền 6,55 inch, tần số qu&eacute;t 90Hz, HDR10+</li>\r\n<li>Hiệu năng mạnh mẽ, ổn định - Chip Snapdragon 780G tr&ecirc;n 5nm, 128GB bộ nhớ v&agrave; 8GB RAM</li>\r\n<li>Camera chụp ảnh ấn tượng - Cụm 3 camera sau 64MP, chụp đ&ecirc;m r&otilde; n&eacute;t</li>\r\n<li>Sạc nhanh, trải nghiệm suốt ng&agrave;y d&agrave;i - Dung lượng pin 4250 mAh v&agrave; hỗ trợ sạc nhanh 33W</li>\r\n</ul>\r\n</div>','2022-01-09 15:26:57','2022-01-30 15:26:56',0,NULL,2,1,1,1,'product/wbpuw0gs8d1y1tu8ho9w');
INSERT INTO `products` VALUES (16,'Bàn điện nâng hạ E-Dra ELT1460 - Gaming Master',8,100,10000,100,20,'<h2 class=\"ddnb-title spct-title\">Đ&aacute;nh gi&aacute; B&agrave;n điện n&acirc;ng hạ E-Dra ELT1460 - Gaming Master</h2>\r\n<h3>Thiết kế chắc chắn</h3>\r\n<p>B&agrave;n gaming&nbsp;E-Dra EGT1460T với thiết kế sử dụng hợp kim nh&ocirc;m chắc chắn c&ugrave;ng c&aacute;ch thiết kế th&ocirc;ng minh, gi&uacute;p sản phẩm c&oacute; thể chịu lực tốt. Thiết kế thanh mảnh, ch&acirc;n chữ T, sang trọng, dễ d&agrave;ng di chuyển hơn rất nhiều</p>\r\n<h3>Mặt b&agrave;n cao cấp</h3>\r\n<p>B&agrave;n gaming EGT1460T được trang bị mặt b&agrave;n bằng nhựa ABS cao cấp, k&iacute;ch thước 1,4m x 0.6m, v&agrave; phủ l&ecirc;n đ&oacute; l&agrave; chất liệu P2PB Carbon Fiber - đ&acirc;y l&agrave; một chất liệu rất bền, gi&uacute;p tăng độ bền của mặt b&agrave;n l&ecirc;n gấp nhiều lần, đồng thời l&agrave;m tăng t&iacute;nh thẩm mỹ cho g&oacute;c m&aacute;y.</p>','2022-01-09 15:47:46','2022-01-15 15:47:44',0,NULL,2,1,1,1,'product/f9wlidrjusztbu2u4ene');
INSERT INTO `products` VALUES (17,'Máy Pha Cà Phê Delonghi',10,200,20000,200,100,'<h3>M&aacute;y Pha C&agrave; Ph&ecirc; Delonghi&nbsp;ECP33.21.R cho ra những ly c&agrave; ph&ecirc; n&oacute;ng hổi thơm ngon chỉ sau khoảng 20 - 25 gi&acirc;y pha chế nhờ c&ocirc;ng suất mạnh mẽ đến 1100W</h3>\r\n<h3>Thiết kế 2 v&ograve;i nhỏ giọt sử dụng tiện lợi, c&ugrave;ng l&uacute;c cho ra 2 ly c&agrave; ph&ecirc; thơm ngon, phục vụ tốt cho nhu cầu sử dụng của cả gia đ&igrave;nh hay d&ugrave;ng cho văn ph&ograve;ng</h3>\r\n<p>Kiểu d&aacute;ng hiện đại, sang trọng với k&iacute;ch thước nhỏ gọn, trọng lượng nhẹ, lớp vỏ ngo&agrave;i bằng nhựa cao cấp c&oacute; c&aacute;c chi tiết mạ crom s&aacute;ng b&oacute;ng, bền bỉ, &iacute;t b&aacute;m bẩn, dễ lau ch&ugrave;i.</p>\r\n<p>Delonghi&nbsp;ECP33.21.R l&agrave; sản phẩm của &Yacute;, mang phong c&aacute;ch &Yacute;, vừa hiện đại, vừa cổ điển, d&ugrave;ng đẹp cho mọi kh&ocirc;ng gian.</p>','2022-01-09 19:36:12','2022-01-15 19:36:10',0,NULL,2,0,1,1,'product/tpyufwivhcmfftvn5wtp');
INSERT INTO `products` VALUES (18,'Khung giường đơn | BILLUND',7,400,NULL,400,100,'<p>Với xu hướng thiết kế hiện nay, th&igrave; ph&ograve;ng ngủ thường bị thu hẹp diện t&iacute;ch rất nhiều. V&igrave; vậy để c&oacute; sự tinh tế, h&agrave;i h&ograve;a cho căn ph&ograve;ng của bạn, th&igrave; việc lựa chọn giường ngủ ph&ugrave; hợp cũng hết sức quan trọng. Với những ai c&ograve;n độc th&acirc;n, hay những gia đ&igrave;nh c&oacute; con nhỏ th&igrave; việc lựa chọn giường đơn chắc chắn sẽ l&agrave; một &yacute; tưởng kh&ocirc;ng tồi ch&uacute;t n&agrave;o. N&oacute; sẽ gi&uacute;p cho ph&ograve;ng của bạn trở n&ecirc;n ngăn nắp v&agrave; đầy tho&aacute;ng đ&atilde;ng<br /><strong><br />Th&ocirc;ng tin sản phẩm</strong>: Khung giường đơn | BILLUND | gỗ c&ocirc;ng nghiệp | trắng x&aacute;m| R90xD200cm<br />- Chất liệu: Gỗ c&ocirc;ng nghiệp<br />- K&iacute;ch thước: R90xD200cm<br />- M&agrave;u sắc: Trắng/x&aacute;m</p>\r\n<p>Khung giường đơn BILLUND l&agrave; sản phẩm của&nbsp;<strong>JYSK &ndash; thương hiệu cung cấp giải ph&aacute;p trang tr&iacute; v&agrave; nội thất phong c&aacute;ch Bắc &Acirc;u đến từ Đan Mạch</strong>.</p>','2022-01-09 19:52:02','2022-01-15 19:52:00',0,NULL,2,1,1,1,'product/uj0xdkq3cri4v8ksar2g');
INSERT INTO `products` VALUES (19,'Writing Table',8,300,30000,300,50,'<p>Writing table with two drawers. Ohio, circa 1825. H 29-3/8\" W 20-3/8\" D18-1/2\" Condition: Excellent original condition.</p>','2022-01-09 20:07:38','2022-01-15 20:07:35',0,NULL,2,0,1,1,'product/i8bxlaeszanomqkkpjdl');
